import React from 'react'

const Intro2 = () => {
  return (
    <div>당신은 오늘은 식료품을 사러 근처 마트에 들렀습니다.
    이곳은 당신이 자주 방문하는 집 근처의 식료품점이며, 당신은 이 가게의 구조와 주변 환경에 익숙합니다.</div>
  )
}

export default Intro2
